import React from 'react'
import { useNavigate } from 'react-router-dom';

const home = "/";
const register = "register";
const login = "login";
const menu = "menu";

function Navbar2() {

    function NavigateToLink(denumire){
        const navigate = useNavigate();
    
        if(denumire === "/"){
            navigate("/");
        }
    
        navigate("/" + denumire);
    }

    return (
        <div className='navbar'>
            <div className='containerNavbarButtons'>
                <button className="navbarButtons" id="menuAbout" onClick={() => {NavigateToLink(home)}}>About</button>
                <button className="navbarButtons" id="menuRegister" onClick={() => {NavigateToLink(register)}}>Register</button>
                <button className="navbarButtons" id="loginMenu">Login</button>
                <button className="navbarButtons" id="menu">Menu</button>
            </div>
        </div>
    )
}

export default Navbar2;
